Ở Long Biên có một tiệm bánh…
Ban đầu chỉ tiếp những khách được mời đến;
Dần dần những vị khách mê ăn uống, thích trải nghiệm &amp; không ít hiếu kì có thể đặt bàn để tới thưởng thức. Và cũng chỉ những khách đã đặt bàn mới được tiếp đón ở đây;
Chỉ mở cửa vào thứ 7, Chủ Nhật &amp; đóng cửa tất cả những ngày còn lại trong tuần để chill, tận hưởng cuộc sống &amp; nghiên cứu sản phẩm mới;
Không có menu cố định, bởi mỗi tuần sẽ đều là những loại bánh mới, kết hợp với những bình cà phê đặc sản được thiết kế riêng phù hợp cùng bánh của tuần;
Cánh cửa luôn luôn đóng kể cả trong những ngày bán hàng. Khách tới vui lòng bấm chuông và chờ người mở cửa dẫn lối;
Thường xuyên trong tình trạng sold-out dù mới mở được nửa buổi;
Không bao giờ đông đúc, ồn ào hay gặp những cảnh chụp ảnh check-in nhốn nháo khắp nơi tới khi trà nguội, bánh chảy;
Chỉ có bánh dâu vào ngày những quả dâu tươi ngon - thơm ngọt nhất, không bao giờ có macaron hay pavlova vào những ngày trời nồm ẩm ương, v.v…

Khách hàng là thượng đế? Không. Ở đây chủ tiệm mới là thượng đế.

Đứng trong căn bếp bánh lấp lánh những ngọt ngào của cửa tiệm ấy là Ít Ngọt - pâtissière và cũng là chủ tiệm kiêm nhân viên trực page, kiêm nhân viên nhận order, kiêm phục vụ, thu ngân. Ít Ngọt có lẽ là một trong rất hiếm những chủ tiệm mà mình từ một khách hàng bình thường, không biết từ bao giờ đã trở nên thân thiết &amp; coi như một người bạn. Không bàn tới việc ả đã du học ở Pháp gần 10 năm, học tại Le Cordon Bleu danh tiếng hay từng thực tập tại Fauchon Paris, mình thích Ít Ngọt vì chính ả - khó tính, tiêu chuẩn cao, cực đoan, chỉ làm những gì ả thích &amp; làm một cách tốt nhất có thể cũng như không ngừng liên tục nâng cấp để ngày một hoàn thiện hơn. 
Đọc đến đây chắc mọi người cũng đã biết, đây không phải một bài review. Mình sẽ không review về nơi này làm gì cho mất thời gian, cứ nhìn tần suất mình tới ăn mòn tủ bánh của ả Ít Ngọt là đủ hiểu.😌

