@danielwellington’s Quandro Studio Collection.

This collection is a homage to the 70’s style icons; features a delicate - square dials, with rounded edges and sleek piano straps! Available in rose gold plating or silver sleek piano strap with classic White, sophisticated Black, or unique green-patterned dial. Style the Quadro Studio with any Vintage inspired outfits to instantly elevate your looks. Find out more about the new collections at www.danielwellington.com or any of their official retail stores in Singapore &amp; Malaysia! P.S. Remember check out my IG story for a special surprise! 
