@tenyasg is collaborating with Aomori Prefecture in Japan to bring you ‘Waltzing into Aomori’; the spread they have in store will let you experience the best of Aomori Japan’s produce, from 20 Feb to 31 Mar.
The crafted menu was arranged to allow the pristine ingredients of this collaboration to shine through - amazing produce specially flown over from Aomori Prefecture.
If you’re a fan of Tenya’s Tempura Tendons, the Aomori Tendon is not one to miss. Sink your teeth into fresh tempura Aomori squid and scallop with morsels of Masshigura rice, all of which are ingredients from Aomori 😋

@taiersingapore’s Chinese sauerkraut fish! Fresh fish slices in a sour-spicy soup. Their other dishes ain't half bad too! A fun dining experience — just remember to reserve a table online (fastest fingers first).
