@flippers.singapore’s got its yolk game on 🍳

🥞 Of all the soufflé pancakes I’ve tried in Singapore, they still serve the best ones for me. Not only do they nail the pancakes, but the eggs as well. I’ve never seen a yolk flow out so smoothly as theirs!

